import React from "react";
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from "react-router-dom";

import Header from "./Header";
import Cats from "./Cats";
import Dogs from "./Dogs";
import "./App.css";

function Main() {
  return (
    <BrowserRouter >
    <div className="main">
      <Header />
    </div>
    <Switch>
    <Route path="/cats" children={<Cats />} />
    <Route path="/dogs" children={<Dogs />} />
    </Switch>
    </BrowserRouter>

  );
}

export default Main;
